insert into <?=snpRef.getObjectName("L", "AT37_ATM_ATS", "LS_AT_STG", "", "D") ?> ( TIPOTRANSFERENCIA, CLASIFICACION, TIPOCLIENTE, IDENTIFICACIONCLIENTE, NOMBRECLIENTE, TIPOINSTRUMENTO, CUENTACLIENTE, MONEDA, MONTO, FECHA, REFERENCIA, EMPRESAFORMACION, MOTIVO, DIRECCIONIP, TIPOCONTRAPARTE, IDENTIFICACIONCONTRAPARTE, NOMBRECONTRAPARTE, TIPOINSTRUMENTOCONTRAPARTE, CUENTACONTRAPARTE, OFICINA
)
select TIPOTRANSFERENCIA, CLASIFICACION, TIPOCLIENTE, IDENTIFICACIONCLIENTE, NOMBRECLIENTE, TIPOINSTRUMENTO, CUENTACLIENTE, MONEDA, MONTO, FECHA, REFERENCIA, EMPRESAFORMACION, MOTIVO, DIRECCIONIP, TIPOCONTRAPARTE, IDENTIFICACIONCONTRAPARTE, NOMBRECONTRAPARTE, TIPOINSTRUMENTOCONTRAPARTE, CUENTACONTRAPARTE, OFICINA
FROM (
select DISTINCT 6 TIPOTRANSFERENCIA, 1 CLASIFICACION, CASE WHEN SUBSTR(ATS.EN_CED_RUC,1,1) is null THEN 'P' WHEN SUBSTR(ATS.EN_CED_RUC,1,1) is not null THEN SUBSTR(ATS.EN_CED_RUC,1,1) END TIPOCLIENTE, CASE WHEN TRIM(ATS.EN_CED_RUC) is null THEN ATS.P_PASAPORTE WHEN TRIM(ATS.EN_CED_RUC) is not null THEN SUBSTR(ATS.EN_CED_RUC,2,LENGTH(ATS.EN_CED_RUC)) END IDENTIFICACIONCLIENTE, TRIM(ATS.EN_NOMLAR) NOMBRECLIENTE, ATS.TIPO_CUENTA TIPOINSTRUMENTO, TRIM(ATS.TH_CTA_BANCO) CUENTACLIENTE, '#ODI_AT_SUDEBAN_DEV.Moneda_Vzla' MONEDA, TRIM(ATS.TH_VALOR) MONTO, ATS.TH_FECHA FECHA, TRIM(ATS.TH_SSN_LOCAL) REFERENCIA, CASE WHEN SUBSTR(ATS.EN_CED_RUC,1,1) IN('F','R') THEN '1' WHEN SUBSTR(ATS.EN_CED_RUC,1,1) IN('M') THEN '2' ELSE '0' END EMPRESAFORMACION, CASE WHEN CONCAT(TO_CHAR(ATS.TH_TIPO_TRAN), ATS.TT_TRN_NOMBRE) is null THEN 'No Disponible' WHEN CONCAT(TO_CHAR(ATS.TH_TIPO_TRAN), ATS.TT_TRN_NOMBRE)is not null THEN CONCAT(TO_CHAR(ATS.TH_TIPO_TRAN), ATS.TT_TRN_NOMBRE) END MOTIVO, '#ODI_AT_SUDEBAN_DEV.AT37_IPATM' DIRECCIONIP, SUBSTR(ATS_D.EN_CED_RUC,1,1) TIPOCONTRAPARTE, CASE WHEN TRIM(ATS_D.EN_CED_RUC) is null THEN ATS_D.P_PASAPORTE WHEN TRIM(ATS_D.EN_CED_RUC) is not null THEN SUBSTR(ATS_D.EN_CED_RUC,2,LENGTH(ATS_D.EN_CED_RUC)) END IDENTIFICACIONCONTRAPARTE, TRIM(ATS_D.EN_NOMLAR) NOMBRECONTRAPARTE, ATS_D.TIPO_CUENTA TIPOINSTRUMENTOCONTRAPARTE, TRIM(ATS.TH_CTA_BANCO_D) CUENTACONTRAPARTE, R_OFCONTA.RE_OFCONTA OFICINA from <?=snpRef.getObjectName("L", "R_OFCONTA", "LS_AT_STG", "", "D")?> R_OFCONTA, <?=snpRef.getObjectName("L", "ATS", "LS_AT_STG", "", "D")?> ATS, <?=snpRef.getObjectName("L", "ATS_D", "LS_AT_STG", "", "D")?> ATS_D where (1=1) And (trim(ATS.TH_CTA_BANCO_D)=trim(ATS_D.TH_CTA_BANCO_D)) AND (ATS.TH_OFICINA=R_OFCONTA.RE_OFCONTA)
) ODI_GET_FROM

